CREATE TABLE IF NOT EXISTS customers(
  customer_id INTEGER PRIMARY KEY,
  name TEXT NOT NULL,
  email TEXT UNIQUE,
  created_at TEXT
);

CREATE TABLE IF NOT EXISTS products(
  product_id INTEGER PRIMARY KEY,
  name TEXT NOT NULL,
  price REAL NOT NULL,
  category TEXT
);

CREATE TABLE IF NOT EXISTS orders(
  order_id INTEGER PRIMARY KEY,
  customer_id INTEGER NOT NULL,
  created_at TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS order_items(
  order_id INTEGER NOT NULL,
  product_id INTEGER NOT NULL,
  qty INTEGER NOT NULL CHECK(qty>0)
);

CREATE TABLE IF NOT EXISTS departments(
  dept_id INTEGER PRIMARY KEY,
  dept_name TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS tags(
  tag_id INTEGER PRIMARY KEY,
  name TEXT UNIQUE
);

CREATE TABLE IF NOT EXISTS post_tags(
  post_id INTEGER,
  tag_id INTEGER
);

CREATE TABLE IF NOT EXISTS books(
  book_id INTEGER PRIMARY KEY,
  title TEXT,
  author_id INTEGER,
  price REAL
);

CREATE TABLE IF NOT EXISTS authors(
  author_id INTEGER PRIMARY KEY,
  name TEXT
);

CREATE TABLE IF NOT EXISTS members(
  member_id INTEGER PRIMARY KEY,
  name TEXT,
  city TEXT,
  joined_at TEXT
);

CREATE TABLE IF NOT EXISTS devices(
  device_id INTEGER PRIMARY KEY,
  name TEXT,
  location TEXT
);

CREATE TABLE IF NOT EXISTS sensors(
  sensor_id INTEGER PRIMARY KEY,
  device_id INTEGER,
  kind TEXT
);

CREATE TABLE IF NOT EXISTS readings(
  reading_id INTEGER PRIMARY KEY,
  sensor_id INTEGER,
  value REAL,
  measured_at TEXT
);

CREATE VIEW IF NOT EXISTS v_orders_with_customer AS
SELECT o.order_id, o.created_at, c.customer_id, c.name AS customer_name
FROM orders o JOIN customers c ON o.customer_id=c.customer_id;

INSERT INTO products(product_id, name, price)
VALUES(?, ?, ?)
ON CONFLICT(product_id) DO UPDATE SET name=excluded.name, price=excluded.price;

WITH recent_orders AS (
  SELECT * FROM orders WHERE created_at >= date('now','-7 days')
)
SELECT ro.order_id, c.name
FROM recent_orders ro JOIN customers c ON ro.customer_id=c.customer_id;

WITH RECURSIVE nums(n) AS (
  SELECT 1
  UNION ALL
  SELECT n+1 FROM nums WHERE n < 10
)
SELECT * FROM nums;

SELECT * FROM customers c WHERE EXISTS (
  SELECT 1 FROM orders o WHERE o.customer_id=c.customer_id
);

SELECT p.post_id, p.title,
  (SELECT COUNT(*) FROM comments c WHERE c.post_id=p.post_id) AS comment_count
FROM posts p;

