WITH ranked AS (
  SELECT l.*, r.*, ROW_NUMBER() OVER (PARTITION BY r.customer_id ORDER BY l.customer_id DESC) rn
  FROM orders l JOIN customers r ON l.customer_id=r.customer_id
)
SELECT * FROM ranked WHERE rn=1;

SELECT r.customer_id AS key, COUNT(l.customer_id) AS child_count
FROM customers r LEFT JOIN orders l ON l.customer_id=r.customer_id
GROUP BY r.customer_id;

WITH ranked AS (
  SELECT l.*, r.*, ROW_NUMBER() OVER (PARTITION BY r.order_id ORDER BY l.order_id DESC) rn
  FROM order_items l JOIN orders r ON l.order_id=r.order_id
)
SELECT * FROM ranked WHERE rn=1;

SELECT r.order_id AS key, COUNT(l.order_id) AS child_count
FROM orders r LEFT JOIN order_items l ON l.order_id=r.order_id
GROUP BY r.order_id;

WITH ranked AS (
