SELECT z.customer_id AS key, COUNT(*) AS cnt
FROM order_items x JOIN orders y ON x.order_id=y.order_id JOIN customers z ON y.customer_id=z.customer_id
GROUP BY z.customer_id;

SELECT z.order_id AS key, COUNT(*) AS cnt
FROM order_items x JOIN products y ON x.product_id=y.product_id JOIN orders z ON y.order_id=z.order_id
GROUP BY z.order_id;

SELECT z.post_id AS key, COUNT(*) AS cnt
FROM post_tags x JOIN posts y ON x.post_id=y.post_id JOIN comments z ON y.post_id=z.post_id
GROUP BY z.post_id;

SELECT z.author_id AS key, COUNT(*) AS cnt
FROM loans x JOIN books y ON x.book_id=y.book_id JOIN authors z ON y.author_id=z.author_id
GROUP BY z.author_id;

SELECT z.device_id AS key, COUNT(*) AS cnt
FROM readings x JOIN sensors y ON x.sensor_id=y.sensor_id JOIN devices z ON y.device_id=z.device_id
GROUP BY z.device_id;

